import React from "react";
import BtnBtn from "../Button/BtnBtn";

function Home() {
  return (
    <div>
      <Nav />
      <div className="p-5 text-center bg-image" id="intro">
        <div className="mask" style="background-color: rgba(0, 0, 0, 0.242)">
          <div className="d-flex justify-content-center align-items-center h-100">
            <div className="text-white">
              <h1 className="mb-3">Full Stack Web Developement</h1>
              <BtnBtn text="Projects" link="#projects" />
              <BtnBtn text="Contact Me" link="#contact-me" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
